	"A Hard Day's Night": ["A Hard Day's Night", 1964, 135.0, 'ジョン・ポール', '', 'https://beatlesdata.info/3/01_aharddaysnight.html', '1ZcDaKyfvKg', 'J-160E・360-12・ヘフナー・カウベル', 'QlZ31qhJNO8', '5J2CHimS7dWYMImCHkEFaJ', "<br>It's been a hard day's night, and I've been working like a dog<br>It's been a hard day's night, I should be sleeping like a log<br>But when I get home to you I find the things that you do<br>Will make me feel alright<br><br>You know I work all day to get you money to buy you things<br>And it's worth it just to hear you say you're going to give me everything<br>So why on earth should I moan, cos when I get you alone<br>You know I feel OK<br><br>When I'm home everything seems to be right<br>When I'm home feeling you holding me tight, tight, yeah<br><br>It's been a hard day's night, and I've been working like a dog<br>It's been a hard day's night, I should be sleeping like a log<br>But when I get home to you I find the things that you do<br>Will make me feel alright owww<br><br>So why on earth should I moan, cos when I get you alone<br>You know I feel OK<br><br>When I'm home everything seems to be right<br>When I'm home feeling you holding me tight, tight, yeah<br><br>It's been a hard day's night, and I've been working like a dog<br>It's been a hard day's night, I should be sleeping like a log<br>But when I get home to you I find the things that you do<br>Will make me feel alright<br>You know I feel alright<br>You know I feel alright<br>"],
