	"I'm Happy Just To Dance With You": ["A Hard Day's Night", 1964, 132.0, 'ジョージ', 'ジョン・ポール', 'https://beatlesdata.info/3/04_imhappyjusttodancewithyou.html', '', '325・6122・ヘフナー', 'ZzIhs1ZQcGY', '0gd50I2gKioJ59C827EdAY', "<br>Before this dance is through<br>I think I'll love you too<br>I'm so happy when you dance with me<br><br>I don't want to kiss or hold your hand<br>If it's funny try and understand<br>There is really nothing else I'd rather do<br>Cos I'm happy just to dance with you<br><br>I don't need to hug or hold you tight<br>I just want to dance with you all night<br>In this world there's nothing I would rather do<br>Cos I'm happy just to dance with you<br><br>Just to dance with you<br>It's everything I need<br>Before this dance is through<br>I think I'll love you too<br>I'm so happy when you dance with me<br><br>If somebody tries to take my place<br>Let's pretend we just can't see his face<br>In this world there's nothing I would rather do<br>Cos I'm happy just to dance with you<br><br>Just to dance with you<br>It's everything I need<br>Before this dance is through<br>I think I'll love you too<br>I'm so happy when you dance with me<br><br>If somebody tries to take my place<br>Let's pretend we just can't see his face<br>In this world there's nothing I would rather do<br>I've discovered I'm in love with you<br>Cos I'm happy just to dance with you<br>"],
