	"Any Time At All": ["A Hard Day's Night", 1964, 141.0, 'ジョン・ポール', '', 'https://beatlesdata.info/3/08_anytimeatall.html', 'lldL77hOaQI', 'J-160E・360-12・ヘフナー・ピアノ', 'xbLVgQ--IMg', '70XHAdaMaoLIOVb1hSaeJ4', "<br>Any time at all, any time at all<br>Any time at all, all you've gotta do is call and I'll be there<br><br>If you need somebody to love<br>Just look into my eyes<br>I'll be there to make you feel right<br><br>If you're feeling sorry and sad<br>I'd really sympathize<br>Don't you be sad, just call me tonight<br><br>Any time at all, any time at all<br>Any time at all, all you've gotta do is call and I'll be there<br><br>If the sun has faded away<br>I'll try to make it shine<br>There's nothing I won't do<br>When you need a shoulder to cry on<br>I hope it will be mine<br>Call me tonight, and I'll come to you<br><br>Any time at all, any time at all<br>Any time at all, all you've gotta do is call and I'll be there<br><br>Any time at all, any time at all<br>Any time at all, all you've gotta do is call and I'll be there<br>Any time at all, all you've gotta do is call and I'll be there<br>"],
	"I'll Cry Instead": ["A Hard Day's Night", 1964, 97.0, 'ジョン', '', 'https://beatlesdata.info/3/09_illcryinstead.html', '', 'J-160E・6122・ヘフナー・タンバリン', 'f0jvWXwVlEc', '01xMiErR26kH1KCif6uEYI', "<br>I've got every reason on earth to be mad<br>Cos I've just lost the only girl I had<br>And if I could get my way<br>I'd get myself locked up today<br>But I can't so I cry instead<br><br>I've got a chip on my shoulder that's bigger than my feet<br>I can't talk to people that I meet<br>And if I could see you now<br>I'd try to make you sad somehow<br>But I can't so I cry instead<br><br>Don't want to cry when there's people there<br>I get shy when they start to stare<br>I'm gonna hide myself away, ay hay<br>But I'll come back again someday<br><br>And when I do you'd better hide all the girls<br>I'm gonna break their hearts all 'round the world<br>Yes, I'm gonna break them in two<br>And show you what your loving man can do<br>Until then I'll cry instead<br><br>Don't want to cry when there's people there<br>I get shy when they start to stare<br>I'm gonna hide myself away, ay hay<br>But I'll come back again someday<br><br>And when I do you'd better hide all the girls<br>Cos I'm gonna break their hearts all 'round the world<br>Yes, I'm gonna break them in two<br>And show you what your loving man can do<br>Until then I'll cry instead<br>"],
	"Things We Said Today": ["A Hard Day's Night", 1964, 137.0, 'ポール', 'ジョン', 'https://beatlesdata.info/3/10_thingswesaidtoday.html', 'RM7Cs_DVbts', 'J-160E・6122・ヘフナー・タンバリン', 'R1in8Ds2l8c', '0voUr8lubIafUVJlauJxYF', "<br>You say you will love me<br>If I have to go<br>You'll be thinking of me<br>Somehow I will know<br>Someday when I'm lonely<br>Wishing you weren't so far away<br>Then I will remember<br>Things we said today<br><br>You say you'll be mine, girl<br>Till the end of time<br>These days such a kind girl<br>Seems so hard to find<br>Someday when we're dreaming<br>Deep in love, not a lot to say<br>Then we will remember<br>Things we said today<br><br>Me, I'm just the lucky kind<br>Love to hear you say that love is luck<br>And though we may be blind<br>Love is here to stay and that's enough<br><br>To make you mine, girl<br>Be the only one<br>Love me all the time, girl<br>We'll go on and on<br>Someday when we're dreaming<br>Deep in love, not a lot to say<br>Then we will remember<br>Things we said today<br><br>Me, I'm just the lucky kind<br>Love to hear you say that love is luck<br>Though we may be blind<br>Love is here to stay and that's enough<br><br>To make you mine, girl<br>Be the only one<br>Love me all the time, girl<br>We'll go on and on<br>Someday when we're dreaming<br>Deep in love, not a lot to say<br>Then we will remember<br>Things we said today<br>"],
