	"When I'm Sixty-Four": ["Sgt. Pepper's Lonely Hearts Club Band", 1966, 141.0, 'ポール', 'ジョン・ジョージ', 'https://beatlesdata.info/8/09_whenimsixtyfour.html', '', '', '', '1NrbnHlR2BFREcyWXHIHip', "<br>When I get older losing my hair<br>Many years from now<br>Will you still be sending me a valentine<br>Birthday greetings, bottle of wine?<br>If I'd been out till quarter to three<br>Would you lock the door?<br>Will you still need me, will you still feed me<br>When I'm sixty four?<br><br>You'll be older too<br>And if you say the word<br>I could stay with you<br><br>I could be handy, mending a fuse<br>When your lights have gone<br>You can knit a sweater by the fireside<br>Sunday mornings go for a ride<br>Doing the garden, digging the weeds<br>Who could ask for more?<br>Will you still need me, will you still feed me<br>When I'm sixty four?<br><br>Every summer we can rent a cottage in the Isle of Wight<br>If it's not too dear<br>We shall scrimp and save<br>Grandchildren on your knee<br>Vera, Chuck and Dave<br><br>Send me a postcard, drop me a line<br>Stating point of view<br>Indicate precisely what you mean to say<br>Yours sincerely, wasting away<br>Give me your answer, fill in a form<br>Mine forevermore<br>Will you still need me, will you still feed me<br>When I'm sixty four?<br>Ho!<br>"],
