	"The Fool On The Hill": ['Magical Mystery Tour', 1967, 73.0, 'ポール', '', 'https://beatlesdata.info/9/02_thefoolonthehill.html', '', '', '', '6rHh8urosEFRI67xVa6fzU', "<br>Day after day, alone on a hill<br>The man with the foolish grin is keeping perfectly still<br>But nobody wants to know him<br>They can see that he's just a fool<br>And he never gives an answer<br><br>But the fool on the hill<br>Sees the sun going down<br>And the eyes in his head<br>See the world spinning 'round<br><br>Well on the way, head in a cloud<br>The man of a thousand voices talking perfectly loud<br>But nobody ever hears him<br>Or the sound he appears to make<br>And he never seems to notice<br><br>But the fool on the hill<br>Sees the sun going down<br>And the eyes in his head<br>See the world spinning 'round<br><br>And nobody seems to like him<br>They can tell what he wants to do<br>And he never shows his feelings<br><br>But the fool on the hill<br>Sees the sun going down<br>And the eyes in his head<br>See the world spinning 'round<br><br>He never listens to them<br>He knows that they're the fools<br>They don't like him<br><br>The fool on the hill<br>Sees the sun going down<br>And the eyes in his head<br>See the world spinning 'round<br>"],
