	"Back In The U.S.S.R.": ['The Beatles', 1968, 143.0, 'ポール', 'ジョン・ジョージ', 'https://beatlesdata.info/10/01_backintheussr.html', 'BVwbpJslLLg', 'カジノ・ストラト・4001・ピアノ', '81qwoHIvDxI', '0j3p1p06deJ7f9xmJ9yG22', "<br>Oh, flew in by Miami Beach B.O.A.C.<br>Didn't get to bed last night<br>On the way the paper bag was on my knee<br>Man I had a dreadful flight<br><br>I'm back in the U.S.S.R.<br>You don't know how lucky you are boy<br>Back in the U.S.S.R. (Yeah)<br><br>Been away so long I hardly knew the place<br>Gee it's good to be back home<br>Leave it 'til tomorrow to unpack my case<br>Honey disconnect the phone<br><br>I'm back in the U.S.S.R.<br>You don't know how lucky you are boy<br>Back in the U.S.<br>Back in the U.S.<br>Back in the U.S.S.R.<br><br>Well the Ukraine girls really knock me out<br>They leave the West behind<br>And Moscow girls make me sing and shout<br>That Georgia's always on my my my my my my my my my mind<br><br>Aw come on!<br>Ho yeah!<br>Ho yeah!<br>Ho ho yeah!<br>Yeah yeah!<br><br>Yeah I'm back in the U.S.S.R.<br>You don't know how lucky you are boys<br>Back in the U.S.S.R.<br><br>Well the Ukraine girls really knock me out<br>They leave the West behind<br>And Moscow girls make me sing and shout<br>That Georgia's always on my my my my my my my my my mind<br><br>Oh, show me 'round your snow-peaked mountains way down south<br>Take me to your daddy's farm<br>Let me hear your balalaikas ringing out<br>Come and keep your comrade warm<br><br>I'm back in the U.S.S.R.<br>Hey you don't know how lucky you are boys<br>Back in the U.S.S.R.<br><br>Oh let me tell you, honey<br>Hey, I'm back!<br>I'm back in the U.S.S.R.<br>Yes, I'm free!<br>Yeah, back in the U.S.S.R.<br><br>Ha ha<br>"],
	"Dear Prudence": ['The Beatles', 1968, 75.0, 'ジョン', 'ポール・ジョージ', 'https://beatlesdata.info/10/02_dearprudence.html', '', 'J-160E・カジノ・ストラト・4001・ピアノ', '8KIwMGP_FRw', '5NQYyej46WQkgCbnzGD21W', "<br>Dear Prudence, won't you come out to play?<br>Dear Prudence, greet the brand new day<br>The sun is up, the sky is blue<br>It's beautiful and so are you<br>Dear Prudence, won't you come out to play?<br><br>Dear Prudence, open up your eyes<br>Dear Prudence, see the sunny skies<br>The wind is low, the birds will sing<br>That you are part of everything<br>Dear Prudence, won't you open up your eyes?<br><br>Look around round<br>Look around round round<br>Look around<br><br>Dear Prudence, let me see you smile<br>Dear Prudence, like a little child<br>The clouds will be a daisy chain<br>So let me see you smile again<br>Dear Prudence, won't you let me see you smile?<br><br>Dear Prudence, won't you come out to play?<br>Dear Prudence, greet the brand new day<br>The sun is up, the sky is blue<br>It's beautiful and so are you<br>Dear Prudence, won't you come out to play?<br>"],
