	"We Can Work It Out": ['Past Masters', 1965, 106.0, 'ポール', 'ジョン', 'https://beatlesdata.info/16/02_wecanworkitout.html', 'ufbXcCAc22M', ' J-160E・ヘフナー・タンバリン、ハーモニウム', 'ikhERc0bOgA', '7tBAxQ6hD4mhr1sYQhwWDP', "<br>Try to see it my way<br>Do I have to keep on talking till I can't go on?<br>While you see it your way<br>Run the risk of knowing that our love may soon be gone<br><br>We can work it out<br>We can work it out<br><br>Think of what you're saying<br>You can get it wrong and still you think that it's alright<br>Think of what I'm saying<br>We can work it out and get it straight, or say goodnight<br><br>We can work it out<br>We can work it out<br><br>Life is very short, and there's no time<br>For fussing and fighting, my friend<br>I have always thought that it's a crime<br>So I will ask you once again<br><br>Try to see it my way<br>Only time will tell if I am right or I am wrong<br>While you see it your way,<br>There's a chance that we might fall apart before too long<br><br>We can work it out<br>We can work it out<br><br>Life is very short, and there's no time<br>For fussing and fighting, my friend<br>I have always thought that it's a crime<br>So I will ask you once again<br><br>Try to see it my way<br>Only time will tell if I am right or I am wrong<br>While you see it your way<br>There's a chance that we might fall apart before too long<br><br>We can work it out<br>We can work it out<br>"],
