	"Rain": ['Past Masters', 1966, 107.0, 'ジョン', 'ポール・ジョージ', 'https://beatlesdata.info/16/04_rain.html', 'PRMm68eMm1M', '', 'Kls_cSusq2Y', '48TNLcToLs8DWkdj5vYdiW', "<br>If the rain comes they run and hide their heads<br>They might as well be dead<br>If the rain comes, if the rain comes<br><br>When the sun shines they slip into the shade<br>(when the sun shines down)<br>And sip their lemonade<br>(when the sun shines down)<br>When the sun shines, when the sun shines<br><br>Rain, I don't mind<br>Shine, the weather's fine<br><br>I can show you that when it starts to rain<br>(when the rain comes down)<br>Everything's the same<br>(when the rain comes down)<br>I can show you, I can show you<br><br>Rain, I don't mind<br>Shine, the weather's fine<br><br>Can you hear me, that when it rains and shines<br>(when it rains and shines)<br>It's just a state of mind?<br>(when it rains and shines)<br>Can you hear me, can you hear me?<br><br>Sdaeh rieht edih dna nur yeht semoc niar eht fI<br>(rain)<br>(rain)<br>"],
	"Lady Madonna": ['Past Masters', 1968, 110.0, 'ポール', 'ジョン・ジョージ', 'https://beatlesdata.info/16/05_ladymadonna.html', 'XulnGuWAO5U', '', '', '1tM9TBNPjieSOZ2d5VAQ1y', "<br>Lady Madonna, children at your feet<br>Wonder how you manage to make ends meet<br>Who finds the money when you pay the rent<br>Did you think that money was Heaven sent?<br>Friday night arrives without a suitcase<br>Sunday morning creeping like a nun<br>Monday's child has learned to tie his bootlace<br>See how they run<br><br>Lady Madonna, baby at your breast<br>Wonders how you manage to feed the rest?<br><br>See how they run<br><br>Lady Madonna lying on the bed<br>Listen to the music playing in your head<br><br>Tuesday afternoon is never ending<br>Wednesday morning papers didn't come<br>Thursday night your stockings needed mending<br>See how they run<br><br>Lady Madonna, children at your feet<br>Wonder how you manage to make ends meet<br>"],
