	"Revolution": ['Past Masters', 1968, 121.0, 'ジョン', '', 'https://beatlesdata.info/16/08_revolution.html', 'jFvtqsnvVz8', 'カジノ・レスポール・ヘフナー・エレピ', 'NjWuVKVZ74w', '4qh4lu4xf4r3ZkBoyeajuc', "<br>You say you want a revolution<br>Well, you know<br>We all want to change the world<br>You tell me that it's evolution<br>Well, you know<br>We all want to change the world<br><br>But when you talk about destruction<br>Don't you know that you can count me out<br><br>Don't you know it's gonna be alright<br>Alright, alright<br><br>You say you got a real solution<br>Well, you know<br>We'd all love to see the plan<br>You ask me for a contribution<br>Well, you know<br>We're all doing what we can<br><br>But if you want money for people with minds that hate<br>All I can tell you is brother you have to wait<br><br>Don't you know it's gonna be alright<br>Alright, alright, al...<br><br>You say you'll change the constitution<br>Well, you know<br>We all want to change your head<br>You tell me it's the institution<br>Well, you know<br>You'd better free your mind instead<br><br>But if you go carrying pictures of Chairman Mao<br>You ain't gonna make it with anyone anyhow<br><br>Don't you know it's gonna be alright<br>Alright, alright<br><br>Alright, alright<br>Alright, alright<br>Alright, alright<br>Alright, alright<br>"],
	"Don't Let Me Down": ['Past Masters', 1969, 77.0, 'ジョン', 'ポール', 'https://beatlesdata.info/16/10_dontletmedown.html', 's9MFX-vytvM', 'カジノ・レスポール・ヘフナー・エレピ', 'sfpNHBArAqM', '0FP04YnQ8eDxkAH4rlwFar', "<br>Don't let me down, don't let me down<br>Don't let me down, don't let me down<br><br>Nobody ever loved me like she does<br>Oh, she does, yes, she does<br>And if somebody loved me like she do me<br>Oh, she do me, yes, she does<br><br>Don't let me down, don't let me down<br>Don't let me down, don't let me down<br><br>I'm in love for the first time<br>Don't you know it's gonna last<br>It's a love that lasts forever<br>It's a love that has no past (Seeking past)<br><br>Don't let me down, don't let me down<br>Don't let me down, don't let me down<br><br>And from the first time that she really done me<br>Oh, she done me, she done me good<br>I guess nobody ever really done me<br>Oh, she done me, she done me good<br><br>Don't let me down, hey don't let me down<br>Heeeee, don't let me down<br><br>Don't let me down<br>Don't let me down, don't let me let down<br>Can you dig it? Don't let me down<br>"],
	"The Ballad Of John And Yoko": ['Past Masters', 1969, 132.0, 'ジョン', 'ポール', 'https://beatlesdata.info/16/11_theballadofjohnandyoko.html', 'rFZYxA8pHNk', '', '1MH48w9pDaI', '6r7JAngkBzKGDKRUzLgY2U', "<br>Standing in the dock at Southampton<br>Trying to get to Holland or France<br>The man in the mac said, You've got to go back<br>You know they didn't even give us a chance<br><br>Christ you know it ain't easy<br>You know how hard it can be<br>The way things are going<br>They're going to crucify me<br><br>Finally made the plane into Paris<br>Honeymooning down by the Seine<br>Peter Brown called to say<br>You can make it OK<br>You can get married in Gibraltar, near Spain<br><br>Christ you know it ain't easy<br>You know how hard it can be<br>The way things are going<br>They're going to crucify me<br><br>Drove from Paris to the Amsterdam Hilton<br>Talking in our beds for a week<br>The newspapers said, Say what you doing in bed?<br>I said, We're only trying to get us some peace<br><br>Christ you know it ain't easy<br>You know how hard it can be<br>The way things are going<br>They're going to crucify me<br><br>Saving up your money for a rainy day<br>Giving all your clothes to charity<br>Last night the wife said<br>Poor boy, when you're dead<br>You don't take nothing with you<br>But your soul, think!<br><br>Made a lightning trip to Vienna<br>Eating chocolate cake in a bag<br>The newspapers said, She's gone to his head<br>They look just like two gurus in drag<br><br>Christ you know it ain't easy<br>You know how hard it can be<br>The way things are going<br>They're going to crucify me<br><br>Caught an early plane back to London<br>Fifty acorns tied in a sack<br>The men from the press said, We wish you success<br>It's good to have the both of you back<br><br>Christ you know it ain't easy<br>You know how hard it can be<br>The way things are going<br>They're going to crucify me<br>The way things are going<br>They're going to crucify me<br>"],
	"Old Brown Shoe": ['Past Masters', 1969, 143.0, 'ジョージ', 'ジョン・ポール', 'https://beatlesdata.info/16/12_oldbrownshoe.html', '', '', 'nWLIuIm2QnY', '7vMCInGW1N1uTFC1LoklEM', "<br>I want a love that's right but right is only half of what's wrong<br>I want a short haired girl who sometimes wears it twice as long<br>Now I'm stepping out this old brown shoe, baby, I'm in love with you<br>I'm so glad you came here, it won't be the same now, I'm telling you<br><br>You know you pick me up from where some try to drag me down<br>And when I see your smile replace every thoughtless frown<br>Got me escaping from this zoo, baby, I'm in love with you<br>I'm so glad you came here, it won't be the same now when I'm with you<br><br>If I grow up I'll be a singer wearing rings on every finger<br>Not worrying what they or you say I'll live and love and maybe someday<br>Who knows, baby, you may comfort me<br><br>I may appear to be imperfect, my love is something you can't reject<br>I'm changing faster than the weather if you and me should get together<br>Who knows, baby, you may comfort me<br><br>I want that love of yours, to miss that love is something I'd hate<br>I'll make an early start, I'm making sure that I'm not late<br>For you sweet top lip I'm in the queue, baby, I'm in love with you<br>I'm so glad you came here, it won't be the same now when I'm with you<br>I'm so glad you came here, it won't be the same now when I'm with you<br>"],
